(119, 'Pierre Kiroul', 'arena_master.gif', 'arenamaster.png', 2, 314, 17, 7, 'Tu t&#039;appr&ecirc;tes &agrave; entrer dans l&#039;ar&egrave;ne. Fais bien attention, cette zone de combat est r&eacute;serv&eacute; au combat entre joueurs et tu risques de te faire tuer tr&egrave;s vite.', 'Maitre d&#039;ar&egrave;ne', 5, 8),
