(130, 'Aubin Sahalor', 'pirate3.gif', 'pirate2.png', 2, 289, 24, 9, 'Nous naviguons entre les &icirc;les et le continent. Tu veux te rendre sur le continent ? Nous ne prenons que des personnes assez exp&eacute;riment&eacute;s, pour la modique somme de 500 pi&egrave;ces d&#039;or.', 'Marin', 5, 1),
