INSERT INTO `quetes_etapes` (`id`, `etape`, `idquete`, `name`, `pnj`, `text_pnj`, `pnj_valid`, `text_pnj_after`, `text_pnj_quest`, `action_win`) VALUES
(1, 1, 1, 'Tuer des champignons mutants', 1, 'L&#039;intendant V&eacute;limar, depuis la mort du roi Haudan, &eacute;tait tr&egrave;s inquiet. Le prince Nudric qui, avec ses partisans, s&#039;&eacute;tait retir&eacute; dans l&#039;&icirc;le d&#039;Onali, lui avait demand&eacute; d&#039;accueillir les nouveaux partisans d&eacute;sirant se battre &agrave; ses c&ocirc;t&eacute;s.\r\nDepuis plus d&#039;une heure il n&#039;avait vu personne quand soudain il aper&ccedil;ut un nouveau Nudricien qui approchait.\r\nH&eacute; l&#039;ami je suis ici pour t&#039;orienter sur notre belle &icirc;le.\r\n\r\nAvant de t&#039;envoyer voir ton instructeur qui va t&#039;aider &agrave; progresser dans ta classe, j&#039;ai besoin que tu &eacute;limines les champignons qui m&#039;entourent. Je te r&eacute;compenserai pour ton aide.', 1, 'Gr&acirc;ce &agrave; toi je me sens moins en danger. Pour te remercier je te donne un b&acirc;ton pour pouvoir te d&eacute;fendre contre les monstres pr&eacute;sents sur notre &icirc;le, 2 potions de vie et 10 pi&egrave;ces d&#039;or.', '', 0),
(2, 2, 1, 'Recherche de l''instructeur', 1, 'Maintenant il est temps que tu deviennes un vaillant compagnon de notre Prince Nudric.\r\n\r\nPas loin d&#039;ici 4 instructeurs attendent les nouveaux partisans afin de les aider &agrave; progresser dans leurs classes.', 5, 'Soit ! Mais l&#039;apprentissage sera rude ! Pour t&#039;aider voici une petite &eacute;p&eacute;e.', '&lt;i&gt;Vous vous retrouver devant une armoire &agrave; glace aux allures de viking parlant d&#039;une voix forte&lt;/i&gt;\r\n Ah ! Te voila enfin ! V&eacute;limar m&amp;&#039;a parl&eacute; de toi ! Comme &ccedil;a tu veux devenir un puissant guerrier !  ', 0),
(3, 1, 2, 'Tuer des champignons mutants', 1, 'L&#039;intendant V&eacute;limar, depuis la mort du roi Haudan, &eacute;tait tr&egrave;s inquiet. Le prince Nudric qui, avec ses partisans, s&#039;&eacute;tait retir&eacute; dans l&#039;&icirc;le d&#039;Onali, lui avait demand&eacute; d&#039;accueillir les nouveaux partisans d&eacute;sirant se battrent &agrave; ses c&ocirc;t&eacute;s.\r\nDepuis plus d&#039;une heure il n&#039;avait vu personne quand soudain il aper&ccedil;ut un nouveau Nudricien qui approchait.\r\nH&eacute; l&#039;ami je suis ici pour t&#039;orienter sur notre belle &icirc;le.\r\n\r\nAvant de t&#039;envoyer voir ton instructeur qui va t&#039;aider &agrave; progresser dans ta classe, j&#039;ai besoin que tu &eacute;limines les champignons qui m&#039;entourent. Je te r&eacute;compenserai pour ton aide.', 1, 'Gr&acirc;ce &agrave; toi je me sens moins en danger. Pour te remercier je te donne un b&acirc;ton pour pouvoir te d&eacute;fendre contre les monstres pr&eacute;sents sur notre &icirc;le, 10 pi&egrave;ces d&#039;or.', '', 0),
(4, 2, 2, 'Recherche de l''instructeur', 1, 'Maintenant il est temps que tu devienne un vaillant compagnon de notre Prince Nudric.\r\n\r\nPas loin d&amp;#039;ici 4 instructeurs attendent les nouveaux partisans afin de les aider &amp;agrave; progresser dans leurs classes.', 6, 'Moi saluer toi ! Moi entra&icirc;ner toi &agrave; chasser ! \r\n\r\nMoi avoir trouver arc de bois ! Donner toi !', '&lt;i&gt;Un jeune homme, aux allures sauvages vous toise&lt;/i&gt;', 0),
(5, 1, 3, 'Tuer des champignons mutants', 1, 'L&#039;intendant V&eacute;limar, depuis la mort du roi Haudan, &eacute;tait tr&egrave;s inquiet. Le prince Nudric qui, avec ses partisans, s&#039;&eacute;tait retir&eacute; dans l&#039;&icirc;le d&#039;Onali, lui avait demand&eacute; d&#039;accueillir les nouveaux partisans d&eacute;sirant se battrent &agrave; ses c&ocirc;t&eacute;s.\r\nDepuis plus d&#039;une heure il n&#039;avait vu personne quand soudain il aper&ccedil;ut un nouveau Nudricien qui approchait.\r\nH&eacute; l&#039;ami je suis ici pour t&#039;orienter sur notre belle &icirc;le.\r\n\r\nAvant de t&#039;envoyer voir ton instructeur qui va t&#039;aider &agrave; progresser dans ta classe, j&#039;ai besoin que tu &eacute;limines les champignons qui m&#039;entourent. Je te r&eacute;compenserai pour ton aide.', 1, 'Gr&acirc;ce &agrave; toi je me sens moins en danger. Pour te remercier je te donne un b&acirc;ton pour pouvoir te d&eacute;fendre contre les monstres pr&eacute;sents sur notre &icirc;le, 10 pi&egrave;ces d&#039;or.', '', 0),
(6, 2, 3, 'Recherche de l''instructeur', 1, 'Maintenant il est temps que tu devienne un vaillant compagnon de notre Prince Nudric.\r\n\r\nPas loin d&amp;#039;ici 4 instructeurs attendent les nouveaux partisans afin de les aider &amp;agrave; progresser dans leurs classes.', 4, '&lt;i&gt;\r\nl&#039;instructeur jette une poudre blanch&acirc;tre dans l&#039;antre du feu et trace un pentacle sur le sol avec la cendre r&eacute;colt&eacute;e autour de vous puis r&eacute;cite une formule dans un langage qui vous est inconnu.&lt;/i&gt;&lt;br /&gt;\r\n\r\nRetiens le bien ceci est ton premier sort', '&lt;i&gt; Vous apercevez une personne myst&eacute;rieuse cach&eacute;e sous son chapeau et sa cape sombre &lt;/i&gt;&lt;br /&gt;\r\n\r\nJe te salut jeune apprenti, je me pr&eacute;sente, je suis le mage &amp;#65533;. ,charg&eacute; de former tout jeune sorcier de ces terres. Je vais donc t&amp;#65533;apprendre l&amp;#65533;art de la magie.', 0),
(7, 1, 4, 'Tuer des champignons mutants', 1, 'L&#039;intendant V&eacute;limar, depuis la mort du roi Haudan, &eacute;tait tr&egrave;s inquiet. Le prince Nudric qui, avec ses partisans, s&#039;&eacute;tait retir&eacute; dans l&#039;&icirc;le d&#039;Onali, lui avait demand&eacute; d&#039;accueillir les nouveaux partisans d&eacute;sirant se battrent &agrave; ses c&ocirc;t&eacute;s.\r\nDepuis plus d&#039;une heure il n&#039;avait vu personne quand soudain il aper&ccedil;ut un nouveau Nudricien qui approchait.\r\nH&eacute; l&#039;ami je suis ici pour t&#039;orienter sur notre belle &icirc;le.\r\n\r\nAvant de t&#039;envoyer voir ton instructeur qui va t&#039;aider &agrave; progresser dans ta classe, j&#039;ai besoin que tu &eacute;limines les champignons qui m&#039;entourent. Je te r&eacute;compenserai pour ton aide.', 1, 'Gr&acirc;ce &agrave; toi je me sens moins en danger. Pour te remercier je te donne un b&acirc;ton pour pouvoir te d&eacute;fendre contre les monstres pr&eacute;sents sur notre &icirc;le, 10 pi&egrave;ces d&#039;or.', '', 0),
(9, 3, 1, 'Votre premier sort', 5, 'Bien ! Maintenant rapportes moi 10 ailes de chauve souris pour me prouver ta force', 5, 'Tu es sur la bonne voie, guerrier, tu manques juste d&#039;exp&eacute;rience ! Voil&agrave; une arme qui t&#039;ira mieux, car ton bout de bois ne tiendra pas longtemps ! Je vais maintenant t&#039;apprendre une nouvelle technique.', '', 0),
(8, 2, 4, 'Recherche de l''instructeur', 1, 'Maintenant il est temps que tu devienne un vaillant compagnon de notre Prince Nudric.\r\n\r\nPas loin d&#039;ici 4 instructeurs attendent les nouveaux partisans afin de les aider &agrave; progresser dans leurs classes.', 7, '... tu ne connais encore rien de l&#039;importance de la vie... il va falloir que je t&#039;apprenne tout de l&#039;art des soins ... Mais d&#039;abord apprend &agrave; maitriser ton &eacute;nergie gr&acirc;ce &agrave; ce sort', '&lt;i&gt;Vous vous approchez d&#039;un vieil homme qui &agrave; l&#039;air de somnoler&lt;/i&gt;&lt;br /&gt;\r\n\r\n... B&eacute;nis soit tu mon enfant ... les dieux m&#039;ont annonc&eacute; ta venue ... Je t&#039;attendais afin de te transmettre mes connaissances  &lt;br /&gt;\r\n\r\n&lt;i&gt;il ferma les yeux et posa sa main sur votre front&lt;/i&gt;', 0),
(10, 3, 2, 'Votre premier sort', 6, 'Toi devoir apporter 10 ailes souris volante &agrave; moi ! Moi t&#039;apprendre beaucoup apr&egrave;s ', 6, '&lt;i&gt; A la vue de votre arriv&eacute;, l&#039;homme sauvage d&eacute;gage un air de fiert&eacute; semblable &agrave; un animal&lt;/i&gt;\r\n\r\nToi vraiment tr&egrave;s dou&eacute; ! Toi &ecirc;tre bon &eacute;l&egrave;ve de moi. Moi t&#039;apprendre comment augmenter ta puissance avec nature ', '', 0),
(11, 3, 3, 'Votre premier baton', 4, 'Maintenant il te faut un b&acirc;ton de mage, mais il faudra de le m&eacute;riter. Si tu m&#039;apportes 10 ailes de chauve souris je t&#039;en donnerai un', 4, 'Tu as bien travailler, je te l&egrave;gue mon b&acirc;ton, c&#039;est celui avec lequel j&#039;ai tout appris j&#039;esp&egrave;re qu&#039;il t&#039;aidera &agrave; d&eacute;fendre notre faction', '', 0),
(12, 3, 4, 'Votre premier baton', 7, '... et maintenant, avec l&#039;aide des dieux nous allons soigner des animaux ... va chercher des ailes chauves souris dans la caverne&amp;#65533; Elles me permettront de cr&eacute;er des potions de soins. Je te fournirais ensuite un b&acirc;ton de bois pour continuer ta route', 7, 'Hum ces ailes ont l&#039;air en bon &eacute;tat. Prend ce b&acirc;ton mais attention il ne sert pas uniquement &agrave; taper. Ce b&acirc;ton accroit tes qualit&eacute;s spirituelles.', '', 0),
(19, 1, 9, 'En quete de fleurs', 8, 'Hum je vois tu veux ma&icirc;triser la puissance des plantes et contr&ocirc;ler le monde ? Ce n&#039;est pas bien dur mais pourquoi te rendrez ai-je ce service ? Hum je vois je vois. Va me chercher cette liste de plantes et je t&#039;apprendrais tout. Tu devras tuer les plantes vivantes du marais pour r&eacute;cup&eacute;rer ces ingr&eacute;dients', 8, 'Bien je vois que tu as r&eacute;ussi ta mission mais ne fais pas trop le malin il te reste encore beaucoup &agrave; faire dans ce monde.', '', 0),
(20, 1, 10, 'Plus belles les ailes', 9, 'Je collectionne les ailes d&#039;abeilles. Si tu m&#039;en apporte 10 je te donnerais un super cadeau.', 9, 'Rooh c&#039;est super &agrave; toi il y en a m&ecirc;me des que je n&#039;avais pas ! Tient voila un peu d&#039;argent pour toi.', '', 0),
(21, 1, 11, 'Premiers secours', 11, '&lt;i&gt;Une pauvre femme aux joues creus&eacute;es, assise sous un palmier :&lt;/i&gt;&lt;br /&gt;&lt;br /&gt;\r\n\r\nS&#039;il vous plait, pourriez vous m&#039;aider ? Mes enfants et moi n&#039;avont plus rien &agrave; manger depuis plusieurs jours. Auriez vous quelque chose &agrave; nous offrir ?', 11, 'Merci beaucoup, gr&acirc;ce &agrave; vous mes enfants vont pouvoir reprendre des forces. Je n&#039;ai malheureusement rien de pr&eacute;cieux &agrave; t&#039;offrir &agrave; par notre merci.', '', 0),
(22, 2, 11, 'Le puit sans eau', 11, 'Nous sommes pauvres et depuis quelques temps nous n&#039;avons plus d&#039;eau pour faire pousser des r&eacute;coltes. Le puit est &agrave; sec, mais nous ne savons pas pourquoi. Si tu peux te renseigner sa serait vraiment g&eacute;nial', 11, 'Alors comme &ccedil;a c&#039;&eacute;tait des ... Qui bouchaient le puits, encore merci pour tout.', '', 0),
(23, 1, 12, 'Sauver les champignons', 12, 'Je soup&ccedil;onne mon fr&egrave;re d&#039;&ecirc;tre derri&egrave;re cette mutation &eacute;trange des champignons. Ram&egrave;ne moi 5 t&ecirc;tes de chaque champignons afin que je puisse les analyser ', 12, '&lt;i&gt; L&#039;ami des champignons analyse les &eacute;chantillons. Et &agrave; la t&ecirc;te qu&#039;il tire ce n&#039;est pas bon. &lt;/i&gt;&lt;br /&gt;&lt;br /&gt;\r\n\r\nHum sa semble se confirmer. Pr&eacute;pare toi au combat et reviens me voir quand tu seras pr&ecirc;t. En attendant voici ta premi&egrave;re r&eacute;compense', '', 0),
(24, 2, 12, 'Le fr&#65533;re', 12, 'Essaye de trouver mon fr&egrave;re, tel un champignon il doit s&#039;&ecirc;tre cacher dans une grotte. Trouve le et tue le !', 12, 'Hum montre moi ce que tu as trouv&eacute; sur lui.&lt;br /&gt;&lt;br /&gt;\r\n\r\n&lt;i&gt; Il semble complexe &lt;/i&gt;&lt;br /&gt;&lt;br /&gt;\r\n\r\nJe ne pense pas que c&#039;&eacute;tait d&ucirc; &agrave; mon fr&egrave;re. Tu devras continuer &agrave; chercher pour d&eacute;couvrir d&#039;o&ugrave; vient cette mutation', '', 0),
(25, 1, 13, 'Un service bien rendu', 10, 'J&#039;en ai marre de ce boulot ! Tiens toi la tu veux m&#039;aider ? Je ne m&#039;en sort plus avec cette invasion de rats vas donc en tuer une quinzaine', 10, 'Merci tu m&#039;aides beaucoup. Comment &ccedil;&agrave; tu veux une part de mon salaire ? Ok tu l&#039;as bien m&eacute;rit&eacute; mais je te pr&eacute;viens mon salaire est faible.', '', 0),
(26, 1, 14, 'Une faim de loup ? Manger du loup', 13, 'La viande de loup est exquis c&#039;est un plat de choix et le roi adore. Mais je vais bient&ocirc;t &ecirc;tre &agrave; cours. Ram&egrave;ne moi en et je t&#039;apprendrais comment les cusinier.', 13, 'Merci beaucoup gr&acirc;ce &agrave; toi je vais pouvoir continuer &agrave; pr&eacute;parer les plats de notre prince. Tient voila un couteau pour t&#039;exercer &agrave; la cuisine', '', 0),
(27, 1, 17, 'Retrouve le sceau royal', 21, ' Diantre ! Me voila bien accapar&eacute;. Comment vais-je faire pour signer mes d&eacute;crets et mes lettres sans mon sceau ? Et que font ces incapables de serviteurs ? Toi la ! Au lieu de rester planter comme un vulgaire piquet, va me chercher mon sceau !\r\n&lt;br /&gt;\r\nComment cela ? Tu n&#039;est point un de mes valets ? Tu es juste venu m&#039;enqu&eacute;rir qu&#039;un rocher bloquait la route &agrave; l&#039;ouest. Je n&#039;ai que faire de ce probl&egrave;me. Mais si tu me retrouve mon bien, je daignerai faire d&eacute;gager cette route en signe de reconnaissance, pour service rendu. \r\n', 21, 'Merci, gr&acirc;ce &agrave; toi je vais pouvoir exp&eacute;dier les affaires courantes de mon fief. Va maintenant.&lt;br /&gt;\r\nComment ? Tu veux que je d&eacute;blaie la route ? Soit, j&#039;envoie de suite mes gens d&eacute;gager la voie. Cela me permettra de faire des &eacute;changes avec les autres villes.\r\n', '', 0),
(54, 1, 28, 'Tuer des champignons mutants', 23, 'L&amp;#039;intendant V&eacute;limar, depuis la mort du roi Haudan, &eacute;tait tr&egrave;s inquiet. Le prince Nudric qui, avec ses partisans, s&amp;#039;&eacute;tait retir&eacute; dans l&amp;#039;&icirc;le d&amp;#039;Onali, lui avait demand&eacute; d&amp;#039;accueillir les nouveaux partisans d&eacute;sirant se battrent &agrave; ses c&ocirc;t&eacute;s.\r\nDepuis plus d&amp;#039;une heure il n&amp;#039;avait vu personne quand soudain il aper&ccedil;ut un nouveau Nudricien qui approchait.\r\nH&eacute; l&amp;#039;ami je suis ici pour t&amp;#039;orienter sur notre belle &icirc;le.\r\n\r\nAvant de t&amp;#039;envoyer voir ton instructeur qui va t&amp;#039;aider &agrave; progresser dans ta classe, j&amp;#039;ai besoin que tu &eacute;limines les champignons qui m&amp;#039;entourent. Je te r&eacute;compenserai pour ton aide.', 23, 'Gr&acirc;ce &agrave; toi je me sens moins en danger. Pour te remercier je te donne un b&acirc;ton pour pouvoir te d&eacute;fendre contre les monstres pr&eacute;sents sur notre &icirc;le, 10 pi&egrave;ces d&#039;or.', '', 0),
(71, 2, 39, 'Le puit sans eau', 56, 'Nous sommes pauvres et depuis quelques temps nous n&#039;avons plus d&#039;eau pour faire pousser des r&eacute;coltes. Le puit est &agrave; sec, mais nous ne savons pas pourquoi. Si tu peux te renseigner sa serait vraiment g&eacute;nial', 56, 'Alors comme &ccedil;a c&#039;&eacute;tait des ... Qui bouchaient le puits, encore merci pour tout.', '', 0),
