(63, 1, 33, 'Une faim de loup ? Manger du loup', 36, 'La viande de loup est exquis c&amp;#039;est un plat de choix et le roi adore. Mais je vais bient&ocirc;t &ecirc;tre &agrave; cours. Ram&egrave;ne moi en et je t&amp;#039;apprendrais comment les cusinier.', 36, 'Merci beaucoup gr&acirc;ce &agrave; toi je vais pouvoir continuer &agrave; pr&eacute;parer les plats de notre prince. Tient voila un couteau pour t&amp;#039;exercer &agrave; la cuisine', '', 0),
(65, 2, 34, 'Le fr&#65533;re', 33, 'Essaye de trouver mon fr&egrave;re, tel un champignon il doit s&amp;#039;&ecirc;tre cacher dans une grotte. Trouve le et tue le !', 33, 'Hum montre moi ce que tu as trouv&eacute; sur lui.&lt;br /&gt;&lt;br /&gt;\r\n\r\n&lt;i&gt; Il semble complexe &lt;/i&gt;&lt;br /&gt;&lt;br /&gt;\r\n\r\nJe ne pense pas que c&amp;#039;&eacute;tait d&ucirc; &agrave; mon fr&egrave;re. Tu devras continuer &agrave; chercher pour d&eacute;couvrir d&amp;#039;o&ugrave; vient cette mutation', '', 0),
(66, 1, 35, 'La peau des yeux', 34, 'Je d&eacute;teste les serpents ! Je suis venu dans le d&eacute;sert dans le seul but d&#039;en exterminer le maximum ! Suis moi dans ma qu&ecirc;te folle et ram&egrave;nes moi une preuve de leurs morts ! Au moins une bonne dizaine de leurs peaux', 34, 'Merci &agrave; toi !! voil&agrave; l&#039;or que tu m&eacute;rites compagnon', '', 0),
(69, 1, 38, 'Retrouve le sceau royal', 50, ' Diantre ! Me voila bien accapar&eacute;. Comment vais-je faire pour signer mes d&eacute;crets et mes lettres sans mon sceau ? Et que font ces incapables de serviteurs ? Toi la ! Au lieu de rester planter comme un vulgaire piquet, va me chercher mon sceau !\r\n&lt;br /&gt;\r\nComment cela ? Tu n&#039;est point un de mes valets ? Tu es juste venu m&#039;enqu&eacute;rir qu&#039;un rocher bloquait la route &agrave; l&#039;ouest. Je n&#039;ai que faire de ce probl&egrave;me. Mais si tu me retrouve mon bien, je daignerai faire d&eacute;gager cette route en signe de reconnaissance, pour service rendu. \r\n', 50, 'Merci, gr&acirc;ce &agrave; toi je vais pouvoir exp&eacute;dier les affaires courantes de mon fief. Va maintenant.&lt;br /&gt;\r\nComment ? Tu veux que je d&eacute;blaie la route ? Soit, j&#039;envoie de suite mes gens d&eacute;gager la voie. Cela me permettra de faire des &eacute;changes avec les autres villes.\r\n', '', 0),
(68, 1, 37, 'La peau des yeux', 35, 'Je d&eacute;teste les serpents ! Je suis venu dans le d&eacute;sert dans le seul but d&amp;#039;en exterminer le maximum ! Suis moi dans ma qu&ecirc;te folle et ram&egrave;nes moi une preuve de leurs morts ! Au moins une bonne dizaine de leurs peaux', 35, 'Merci &agrave; toi !! voil&agrave; l&amp;#039;or que tu m&eacute;rites compagnon', '', 0),
(72, 1, 40, 'Tuer des champignons mutants', 51, 'L&#039;intendant Cowan, depuis la mort du roi Haudan, &eacute;tait tr&egrave;s inquiet. La princesse Amoda qui, avec ses partisans, s&#039;&eacute;tait retir&eacute;e dans l&#039;&icirc;le de Kaledan, lui avait demand&eacute; d&#039;accueillir les nouveaux partisans d&eacute;sirant se battre &agrave; ses c&ocirc;t&eacute;s.\r\nDepuis plus d&#039;une heure il n&#039;avait vu personne quand soudain il aper&ccedil;ut un nouveau Amodien qui approchait.\r\nH&eacute; l&#039;ami je suis ici pour t&#039;orienter sur notre belle &icirc;le.', 51, 'Gr&acirc;ce &agrave; toi je me sens moins en danger. Pour te remercier je te donne un b&acirc;ton pour pouvoir te d&eacute;fendre contre les monstres pr&eacute;sents sur notre &icirc;le, 10 pi&egrave;ces d&#039;or.', '', 0),
(106, 3, 59, 'la l&#65533;gende du scorpion noir', 120, 'Les scorpions ob&eacute;issent tous &agrave; leur ma&icirc;tre le scorpion noir. Il r&eacute;side dans la grotte du d&eacute;sert. Extermine le et tu recevras une belle r&eacute;compense.', 120, 'Magnifique !! Tu as appris &agrave; ces couards que les humains sont les ma&icirc;tres de ce monde !!', '', 0),
(73, 2, 40, 'Recherche de l''instructeur', 51, 'Maintenant il est temps que tu deviennes un vaillant compagnon de notre Princesse Amoda.\r\n\r\nPas loin d&#039;ici 4 instructeurs attendent les nouveaux partisans afin de les aider &agrave; progresser dans leurs classes.', 59, 'Soit ! Mais l&#039;apprentissage sera rude ! Pour t&#039;aider voici une petite &eacute;p&eacute;e.', '&lt;i&gt;Vous vous retrouver devant une armoire &agrave; glace aux allures de viking parlant d&#039;une voix forte&lt;/i&gt;\r\n Ah ! Te voila enfin ! V&eacute;limar m&amp;&#039;a parl&eacute; de toi ! Comme &ccedil;a tu veux devenir un puissant guerrier !  ', 0),
(74, 3, 40, 'Votre premier sort', 59, 'Bien ! Maintenant rapportes moi 10 ailes de chauve souris pour me prouver ta force', 59, 'Tu es sur la bonne voie, guerrier, tu manques juste d&#039;exp&eacute;rience ! Voil&agrave; une arme qui t&#039;ira mieux, car ton bout de bois ne tiendra pas longtemps ! Je vais maintenant t&#039;apprendre une nouvelle technique.', '', 0),
(75, 1, 41, 'Tuer des champignons mutants', 51, 'L&#039;intendant Cowan, depuis la mort du roi Haudan, &eacute;tait tr&egrave;s inquiet. La princesse Amoda qui, avec ses partisans, s&#039;&eacute;tait retir&eacute;e dans l&#039;&icirc;le de Kaledan, lui avait demand&eacute; d&#039;accueillir les nouveaux partisans d&eacute;sirant se battre &agrave; ses c&ocirc;t&eacute;s.\r\nDepuis plus d&#039;une heure il n&#039;avait vu personne quand soudain il aper&ccedil;ut un nouveau Amodien qui approchait.\r\nH&eacute; l&#039;ami je suis ici pour t&#039;orienter sur notre belle &icirc;le.', 51, 'Gr&acirc;ce &agrave; toi je me sens moins en danger. Pour te remercier je te donne un b&acirc;ton pour pouvoir te d&eacute;fendre contre les monstres pr&eacute;sents sur notre &icirc;le, 10 pi&egrave;ces d&#039;or.', '', 0),
(76, 2, 41, 'Recherche de l''instructeur', 51, 'Maintenant il est temps que tu devienne un vaillant compagnon de notre Princesse Amoda.\r\n\r\nPas loin d&amp;#039;ici 4 instructeurs attendent les nouveaux partisans afin de les aider &amp;agrave; progresser dans leurs classes.', 52, 'Moi avoir trouver arc de bois ! Donner toi !', 'Moi saluer toi ! Moi entra&icirc;ner toi &agrave; chasser ! ', 0),
(77, 3, 41, 'Votre premier sort', 52, 'Toi devoir apporter 10 ailes souris volante &agrave; moi ! Moi t&#039;apprendre beaucoup apr&egrave;s ', 52, '&lt;i&gt; A la vue de votre arriv&eacute;, l&#039;homme sauvage d&eacute;gage un air de fiert&eacute; semblable &agrave; un animal&lt;/i&gt;\r\n\r\nToi vraiment tr&egrave;s dou&eacute; ! Toi &ecirc;tre bon &eacute;l&egrave;ve de moi. Moi t&#039;apprendre comment augmenter ta puissance avec nature ', '', 0),
