(81, 1, 43, 'Tuer des champignons mutants', 51, 'L&#039;intendant Cowan, depuis la mort du roi Haudan, &eacute;tait tr&egrave;s inquiet. La princesse Amoda qui, avec ses partisans, s&#039;&eacute;tait retir&eacute;e dans l&#039;&icirc;le de Kaledan, lui avait demand&eacute; d&#039;accueillir les nouveaux partisans d&eacute;sirant se battre &agrave; ses c&ocirc;t&eacute;s.\r\nDepuis plus d&#039;une heure il n&#039;avait vu personne quand soudain il aper&ccedil;ut un nouveau Amodien qui approchait.\r\nH&eacute; l&#039;ami je suis ici pour t&#039;orienter sur notre belle &icirc;le.', 51, 'Gr&acirc;ce &agrave; toi je me sens moins en danger. Pour te remercier je te donne un b&acirc;ton pour pouvoir te d&eacute;fendre contre les monstres pr&eacute;sents sur notre &icirc;le, 2 potions de vie et 10 pi&egrave;ces d&#039;or.', '', 0),
(104, 1, 59, 'Les poules et les l&#65533;zards d''abord', 120, 'Je combats la vermine depuis des ann&eacute;es !! Aide moi &agrave; les &eacute;liminer et je te r&eacute;compenserai.', 120, 'Voil&agrave; ta r&eacute;compense !! Prends de l&#039;&eacute;quipement, les forces du mal sont sans cesse plus puissantes !!', '', 0),
