(83, 3, 43, 'Votre premier baton', 53, '... et maintenant, avec l&#039;aide des dieux nous allons soigner des animaux ... va chercher des ailes chauves souris dans la caverne&amp;#65533; Elles me permettront de cr&eacute;er des potions de soins. Je te fournirais ensuite un b&acirc;ton de bois pour continuer ta route', 53, 'Hum ces ailes ont l&#039;air en bon &eacute;tat. Prend ce b&acirc;ton mais attention il ne sert pas uniquement &agrave; taper. Ce b&acirc;ton accroit tes qualit&eacute;s spirituelles.', '', 0),
(86, 1, 46, 'En quete de fleurs', 60, 'Hum je vois tu veux ma&icirc;triser la puissance des plantes et contr&ocirc;ler le monde ? Ce n&#039;est pas bien dur mais pourquoi te rendrez ai-je ce service ? Hum je vois je vois. Va me chercher cette liste de plantes et je t&#039;apprendrais tout. Tu devras tuer les plantes vivantes du marais pour r&eacute;cup&eacute;rer ces ingr&eacute;dients', 60, 'Bien je vois que tu as r&eacute;ussi ta mission mais ne fais pas trop le malin il te reste encore beaucoup &agrave; faire dans ce monde.', '', 0),
