(92, 1, 51, 'Premiers secours', 62, '&lt;i&gt;Une pauvre femme aux joues creus&eacute;es, assise sous un palmier :&lt;/i&gt;&lt;br /&gt;&lt;br /&gt;\r\n\r\nS&#039;il vous plait, pourriez vous m&#039;aider ? Mes enfants et moi n&#039;avont plus rien &agrave; manger depuis plusieurs jours. Auriez vous quelque chose &agrave; nous offrir ?', 62, 'Merci beaucoup, gr&acirc;ce &agrave; vous mes enfants vont pouvoir reprendre des forces. Je n&#039;ai malheureusement rien de pr&eacute;cieux &agrave; t&#039;offrir &agrave; par notre merci.', '', 0),
(93, 2, 51, 'Le puit sans eau', 62, 'Nous sommes pauvres et depuis quelques temps nous n&#039;avons plus d&#039;eau pour faire pousser des r&eacute;coltes. Le puit est &agrave; sec, mais nous ne savons pas pourquoi. Si tu peux te renseigner sa serait vraiment g&eacute;nial', 62, 'Alors comme &ccedil;a c&#039;&eacute;tait des ... Qui bouchaient le puits, encore merci pour tout.', '', 0),
(97, 1, 55, 'Premiere experience', 100, 'Tu veux t&#039;entra&icirc;ner au combat ? Voyons si tu peux vaincre des proies faciles.', 100, 'Bien tu es plus fort qu&#039;il n&#039;y para&icirc;t. Reviens me voir si tu te sens de taille &agrave; affronter les ours.', '', 0),
