(102, 1, 58, 'Premiere experience', 101, 'Tu veux t&#039;entra&icirc;ner au combat ? Voyons si tu peux vaincre des proies faciles.', 101, 'Bien tu es plus fort qu&#039;il n&#039;y para&icirc;t. Reviens me voir si tu te sens de taille &agrave; affronter les ours.', '', 0),
(103, 2, 58, 'tuons des ours', 101, 'Il y a une infestation d&#039;ours, gagne mon estime et une r&eacute;compense, en limitant leur expansion.', 101, 'Finalement, tu te r&eacute;v&egrave;le puissant mon ami. Voici ta r&eacute;compense tu l&#039;as bien m&eacute;rit&eacute;e !! ', '', 0),
(107, 1, 60, 'La preuve par 15', 121, 'Ces maudits l&eacute;zards attaquent tout le monde. Il faut leur donner une bonne le&ccedil;on. Va les tuer, pour qu&#039;ils cessent leurs attaques. Ram&egrave;ne moi 15 &eacute;cailles pour preuve de ta bravoure et de ta gloire !!', 121, 'Excellent !! Tu seras peut &ecirc;tre notre prochain h&eacute;ros, prends ceci en remerciement. ', '', 0),
(108, 1, 61, 'les fantomes', 128, 'Les fant&ocirc;mes qui viennent en ville la nuit me font tr&egrave;s peur !! Je t&#039;en pries, aide moi, sauve moi d&#039;eux !!', 128, 'Je vois tu as utilis&eacute; la force pour les faire taire ! Grand merci &agrave; toi.', '', 0),
(109, 1, 62, 'Au secours !!!!!', 118, 'Lib&egrave;re moi de cette mal&eacute;diction. Un terrible fant&ocirc;me hante ma cale.', 118, 'Mon sauveur !! Pour ta bravoure, je te donne mes 2 derniers salaires, que je n&#039;ai pas eu le temps de d&eacute;penser &agrave; la taverne.', '', 0),
(110, 1, 63, 'la peau de fer', 135, 'Tu souhaites am&eacute;liorer ta carrure et ta r&eacute;sistance ? je peux t&#039;y aider. Tu dois tuer 30 scorpions et je t&#039;expliquerais comment utiliser leur puissance !!', 135, 'Ton esprit et ton corps ne doivent faire qu&#039;un. La puissance de ton esprit te permettra de r&eacute;sister aux pires ennemis !!', '', 0),
(111, 1, 64, 'l agilit&#65533; du f&#65533;lin', 135, 'Tu souhaites am&eacute;liorer ta vitesse et ta dext&eacute;rit&eacute; ? je peux t&#039;y aider. Tu dois tuer 20 lynx et je t&#039;expliquerais comment devenir aussi vif qu&#039;eux !!', 135, 'Ton esprit et ton corps ne doivent faire qu&#039;un. Ainsi, tu seras d&#039;une rapidit&eacute; sans &eacute;gale !!', '', 0),
(113, 1, 66, 'force de l esprit', 135, 'Tu souhaites am&eacute;liorer ton intelligence ? Les l&eacute;zards contiennent des connaissances ancestrales. Va donc en tuer 25.', 135, 'Ton esprit et ton corps ne doivent faire qu&#039;un. L&#039;esprit nourrit le corps, et le corps nourrit l&#039;esprit. Un mage en forme est le plus terrible adversaire qui soit !!', '', 0),
(114, 1, 67, 'La sagesse de la grenouille', 135, 'Tu souhaites am&eacute;liorer ta sagesse ? Observer les grenouilles, leur sagesse ancestrale te guidera, pour l&#039;absorber tue en 25', 135, 'Ton esprit et ton corps ne doivent faire qu&#039;un. Observe comment la grenouille utilise son corps pour se r&eacute;g&eacute;n&eacute;rer.', '', 0),
(117, 1, 71, 'La tete du guerrier orc', 139, 'Ce guerrier orc a tu&eacute; ma famille, il a &eacute;trip&eacute; ma femme devant moi ! Retrouve le, fait lui la peau et ram&egrave;ne moi son cadavre !', 139, 'Voil&agrave; pour toi vagabond. Quoi c&#039;est pas assez ? Je t&#039;avais pas dis que l&#039;orc m&#039;avait tout vol&eacute; ?', '', 0),
